import React, {useState} from "react"

function Count() {
    const [count, setCount] = useState(0)
    const [answer, setAnswer] = useState("Yes")

    function increment() {
        setCount(count + 1)
    }
    return(
        <div>
            <h1>count is {count}</h1>
            <button
                onClick={increment}
            >
                Change!
            </button>
            <p>is it true ? {answer}</p>
        </div>
    )
}

export default Count

